DictKey_21: "-- ACTION -> DO SCRIPT:\\\nlocal groupName = 'Tanker Texaco' -- Name\
  \ of the group in the ME\\\nlocal country = 'USA' -- Country for Tanker, like 'USA'\
  \ or 'RUSSIA'\\\nlocal callsign = 1 -- 1 = Texaco, 2 = Arco, 3 = Shell or First\
  \ Number for IL-78M\\\nlocal callsign2 = 1 -- Second Number for IL-78M, irrelevant\
  \ for KC-135\\\n\\\nlocal oldName = groupName\\\nif barons_respawn_script == nil\
  \ then\\\n    barons_respawn_script = {[groupName] = 0}\\\nelseif barons_respawn_script[groupName]\
  \ == nil then\\\n    barons_respawn_script[groupName] = 0\\\nelse\\\n    oldName\
  \ = groupName .. barons_respawn_script[groupName]\\\nend\\\nbarons_respawn_script[groupName]\
  \ = barons_respawn_script[groupName] + 1\\\nlocal newName = groupName .. barons_respawn_script[groupName]\\\
  \n\\\nlocal group = Group.getByName(oldName)\\\nif group then\\\n    group = group:getController()\\\
  \n    Controller.setCommand(group, {id = 'DeactivateBeacon', params = {}})\\\n \
  \   Controller.setTask(group, {id = 'NoTask', params = {}})\\\nend\\\n\\\ngroup\
  \ = mist.getGroupData(groupName)\\\ngroup.route = { points = mist.getGroupRoute(groupName,\
  \ true) }\\\ngroup.groupName = newName\\\ngroup.groupId = nil\\\ngroup.units[1].unitId\
  \ = nil\\\ngroup.units[1].unitName = newName\\\ngroup.country = country\\\ngroup.category\
  \ = 'AIRPLANE'\\\n\\\nmist.dynAdd(group)\\\n\\\ngroup = Group.getByName(newName)\\\
  \ngroup = group:getController()\\\nController.setCommand(group, {id = 'SetCallsign',\
  \ params = {callname = callsign, number = callsign2}})"
