DictKey_ActionText_913: "--RESPAWN SCRIPT; MISSION START -> DO SCRIPT\\\nlocal groupName\
  \ = 'Tanker Texaco' -- Name of the group in the ME\\\nlocal lowFuelThreshold = 0.08\
  \ -- RTB when less then this amount of fuel\\\nlocal lowHealthThreshold = 50 --\
  \ RTB when less then this amount of health\\\nbarons_respawn_script.checkstate(groupName,\
  \ lowFuelThreshold, lowHealthThreshold, true)"
DictKey_ActionText_914: "-- RESPAWN SCRIPT; MISSION START -> DO SCRIPT\\\nlocal oldGroupRemovalTime\
  \ = 600 -- Time (seconds) after which old groups are removed\\\n\\\nbarons_respawn_script\
  \ = {}\\\nbarons_respawn_script.predicate = function(groupName, lowFuelThreshold,\
  \ lowHealthThreshold)\\\n    if barons_respawn_script and barons_respawn_script[groupName]\
  \ then\\\n        groupName = groupName .. barons_respawn_script[groupName]\\\n\
  \    end\\\n    local group = Group.getByName(groupName)\\\n    if not group then\\\
  \n        return true\\\n    end\\\n\\\n    group = group:getUnits()[1]\\\n    if\
  \ not group or Unit.inAir(group) == false then\\\n        return true\\\n    end\\\
  \n    if group:getFuel() < lowFuelThreshold or group:getLife() < lowHealthThreshold\
  \ then\\\n        return true\\\n    end\\\nreturn false\\\nend\\\n\\\nbarons_respawn_script.removeGroup\
  \ = function(group)\\\n    group = Group.getByName(group)\\\n    if group then\\\
  \n        trigger.action.deactivateGroup(group)\\\n    end\\\nend\\\n\\\nbarons_respawn_script.action\
  \ = function(groupName)\\\n    local oldName = groupName\\\n    if barons_respawn_script[groupName]\
  \ == nil then\\\n        barons_respawn_script[groupName] = 0\\\n    else\\\n  \
  \      oldName = groupName .. barons_respawn_script[groupName]\\\n    end\\\n  \
  \  barons_respawn_script[groupName] = barons_respawn_script[groupName] + 1\\\n \
  \   local newName = groupName .. barons_respawn_script[groupName]\\\n\\\n    mist.scheduleFunction(barons_respawn_script.removeGroup,\
  \ {oldName}, timer.getTime() + oldGroupRemovalTime)\\\n    local group = Group.getByName(oldName)\\\
  \n    if group then\\\n        group = group:getController()\\\n        Controller.setCommand(group,\
  \ {id = 'DeactivateBeacon', params = {}})\\\n        Controller.setTask(group, {id\
  \ = 'NoTask', params = {}})\\\n    end\\\n\\\n    group = mist.getGroupData(groupName)\\\
  \n    group.route = { points = mist.getGroupRoute(groupName, true) }\\\n    group.groupName\
  \ = newName\\\n    group.groupId = nil\\\n    group.units[1].unitId = nil\\\n  \
  \  group.units[1].unitName = newName\\\n    group.category = 'AIRPLANE'\\\n\\\n\
  \    mist.dynAdd(group)\\\n\\\n    group = Group.getByName(newName)\\\n    group\
  \ = group:getController()\\\nend\\\n\\\nbarons_respawn_script.checkstate = function(groupName,\
  \ lowFuelThreshold, lowHealthThreshold, oldresult)\\\n    local newresult = barons_respawn_script.predicate(groupName,\
  \ lowFuelThreshold, lowHealthThreshold)\\\n    if oldresult == false and newresult\
  \ == true then\\\n        barons_respawn_script.action(groupName)\\\n    end\\\n\
  \    \\\n    mist.scheduleFunction(barons_respawn_script.checkstate, {groupName,\
  \ lowFuelThreshold, lowHealthThreshold, newresult},  timer.getTime() + 1)\\\nend"
